import Link from "next/link";
import styles from "./navbar.module.css";
import React, {useState} from "react";
import { HamburgerButton } from 'react-hamburger-button';

const Menu = [
  {
    path: "/blog", name: "Blog",
  },
  {
    path: "/#", name: "100DaysofCode",
  },

  ]

function Navbar() {
const [showMenu, setShowMenu] = useState(false);

let menu
console.log(showMenu)
if (showMenu){
  menu = <div className={styles.menu_white}>The Menu</div> 
}

return (
  <header className={styles.header_Wrapper}>
  <div className={styles.div_top_hypers}>
    <div className={styles.logo_left}>NdV</div>
    <ul className={styles.ul_top_hypers}>
     {Menu.map(({path, name}) => (
      <li key={name}>
        <Link href={path} as={path}>
          <a>{name}</a>
        </Link>
      </li>

     ))} 
      </ul>
       </div>
       <div className={styles.menu_right}><button className={styles.button} onClick={() => {setShowMenu(!showMenu)}}><i className="fa fa-bars"></i></button></div>

       <div> 
      {menu}
      </div>
  </header>
  )


         }
export default Navbar;
